INSERT INTO `courses` (`id`, `company_id`, `category`, `name`, `prerequisites`, `theory`, `practice`, `financial`, `created_at`, `updated_at`) VALUES
(1, 1, 'Klassenberechtigungen', 'Klassenberechtigung PA – 46 SET', NULL, 'Findet in Form eines Fernlehrgangs statt.', 'Min. 10 Flugstunden auf PA – 46 SET EFIS. (Kennzeichen: D-FLYW)\nPraxis erfolgt von ETSI aus.', '[{\"name\":\"Verwaltungsgeb\\u00fchr INflight\",\"value\":\"500\"},{\"name\":\"Theorie\",\"value\":\"1624\"},{\"name\":\"15 Stunden mit Fluglehrer inkl. EFIS\",\"value\":\"975\"},{\"name\":\"10 Flugstunden auf PA46\",\"value\":\"11900\"}]', '2020-09-23 11:05:16', '2020-09-28 13:08:31'),
(2, 1, 'CPL(A) / ATPL / IFR', 'ATPL Theorie', NULL, '585 Std. Selbststudium mit Civil Aviation Training (CAT). 72 Std. Frontalunterricht', NULL, '[{\"name\":\"Anmeldegeb\\u00fchr Punitz Flug\",\"value\":\"200\"},{\"name\":\"Verwaltungsaufwand INflight GmbH\",\"value\":\"300\"},{\"name\":\"Theorie CAT Fernlehrgang als eBook\",\"value\":\"2900\"},{\"name\":\"72 Stunden Frontalunterricht\",\"value\":\"1400\"}]', '2020-09-23 11:09:58', '2020-09-28 13:12:08'),
(3, 1, 'CPL(A) / ATPL / IFR', 'CPL Theorie', NULL, '25 Std. Frontalunterricht\nTheorieprüfung muss innerhalb von 18 Monaten angetreten werden und muss nach der ersten Sitzung innerhalb von 12 Monaten komplett bestanden werden.', NULL, '[{\"name\":\"Anmeldegeb\\u00fchr Punitz Flug\",\"value\":\"200\"},{\"name\":\"Verwaltungsaufwand INflight GmbH\",\"value\":\"250\"},{\"name\":\"Theorie CAT Fernlehrgang als eBook\",\"value\":\"1920\"},{\"name\":\"25 Stunden Frontalunterricht\",\"value\":\"500\"}]', '2020-09-23 11:10:26', '2020-09-28 13:13:19'),
(4, 1, 'CPL(A) / ATPL / IFR', 'CPL(A) Praxis', NULL, NULL, '15 Flugstunden wovon 5 Flugstunden auf einem Flugzeug mit Verstellpropeller und Einziehfahrwerk erfolgen müssen.\n\nDie 15 Std. Praxis Ausbildung setzen ein gültiges IR (A) Rating voraus. Ansonsten erhöht sich die praktische Ausbildung auf 25 Stunden.', '[{\"name\":\"Anmeldegeb\\u00fchr Punitzflug (ATO)\",\"value\":\"450\"},{\"name\":\"Anmeldegeb\\u00fchr Inflight GmbH\",\"value\":\"200\"},{\"name\":\"10 Flugstunden PA28 inkl. Fluglehrer\",\"value\":\"2400\"},{\"name\":\"5 Flugstunden auf C182RG inkl. Fluglehrer\",\"value\":\"1875\"}]', '2020-09-23 11:11:11', '2020-09-30 08:11:25'),
(5, 1, 'CPL(A) / ATPL / IFR', 'IFR Theorie', NULL, '72 Std. Selbststudium mit Civil Aviation Training (CAT) \n\n  8 Std. Frontalunterricht (Theorie muss innerhalb von 18 Monaten absolviert werden)', NULL, '[{\"name\":\"Anmeldegeb\\u00fchr Punitzflug (ATO)\",\"value\":\"200\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"250\"},{\"name\":\"Theoria CAT als eBook\",\"value\":\"623\"},{\"name\":\"8 Stunden Frontalunterricht\",\"value\":\"250\"}]', '2020-09-23 11:11:57', '2020-09-28 13:17:08'),
(6, 1, 'CPL(A) / ATPL / IFR', 'IFR Praxis', NULL, NULL, NULL, '[{\"name\":\"Anmeldegeb\\u00fchr Punitzflug (ATO)\",\"value\":\"520\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"250\"},{\"name\":\"40 Stunden PA28 in ETSI mit Fluglehrer a 240\\u20ac\",\"value\":\"9600\"}]', '2020-09-23 11:12:55', '2020-09-28 13:18:13'),
(7, 1, 'PPL(A)', 'PPL(A) ohne Vorerfahrung', NULL, 'Selbststudium mit begleitender Hilfe. Theorie kann bei Bedarf angeboten werden.', 'Min. 45 Flugstunden, davon min. 10 Std. überwachter Alleinflug und einem Überlandflug von min. 270 KM mit Landung auf zwei anderen Flugplätzen.', '[{\"name\":\"Aufnahmegeb\\u00fchr Verein Neuburg\",\"value\":\"250\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"250\"},{\"name\":\"45 Flugstunden a 185\\u20ac\",\"value\":\"8325\"},{\"name\":\"45 Fluglehrerstunden a 45\\u20ac\",\"value\":\"2025\"}]', '2020-09-28 13:19:36', '2020-09-28 13:19:36'),
(8, 1, 'PPL(A)', 'LAPL(A) zu PPL(A)', NULL, 'Wird im Rahmen der praktischen Flugausbildung vermittelt.', 'Mind. 10 Std. Flugausbildung.\nMind. 4 Std. überwachter Alleinflug mit einem 270km Flug und zwei Landungen auf fremden Plätzen.', '[{\"name\":\"Aufnahmegeb\\u00fchr Verein Neuburg\",\"value\":\"250\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"250\"},{\"name\":\"10 Flugstunden a 185\\u20ac\",\"value\":\"1850\"},{\"name\":\"10 Fluglehrerstunden a 45\\u20ac\",\"value\":\"450\"}]', '2020-09-28 13:22:25', '2020-09-28 13:22:25'),
(9, 1, 'PPL(A)', 'Segelflug zu PPL (A)', NULL, 'Wird im Rahmen der Flugausbildung vermittelt.', 'Min. 35 Flugstunden, davon min. 10 Std. überwachter Alleinflug und einem Überlandflug von min. 270 KM mit Landung auf zwei anderen Flugplätzen.\nFlugausbildung erfolgt in Ingolstadt – Manching', '[{\"name\":\"Aufnahmegeb\\u00fchr Verein Neuburg\",\"value\":\"250\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"250\"},{\"name\":\"35 Flugstunden a 185\\u20ac\",\"value\":\"6475\"},{\"name\":\"35 Fluglehrerstunden a 45\\u20ac\",\"value\":\"1575\"}]', '2020-09-28 13:23:24', '2020-09-28 13:24:06'),
(10, 1, 'PPL(A)', 'Segelflug + „TMG“ zum PPL (A)', NULL, 'Wird im Rahmen der praktischen Flugausbildung vermittelt.', 'Mind. 15 Std. Flugausbildung.\n10 Stunden überwachter Alleinflug mit einem Überlandflug von mindestens 270 KM mit 2 Landungen auf fremden Flugplätzen', '[{\"name\":\"Aufnahmegeb\\u00fchr Verein Neuburg\",\"value\":\"250\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"250\"},{\"name\":\"15 Flugstunden a 185\\u20ac\",\"value\":\"2775\"},{\"name\":\"15 Fluglehrerstunden a 45\\u20ac\",\"value\":\"675\"}]', '2020-09-28 13:25:00', '2020-10-02 11:05:28'),
(11, 1, 'LAPL(A)', 'LAPL(A) ohne Vorerfahrung', NULL, 'Selbststudium mit begleitender Hilfe. Theorie kann bei Bedarf angeboten werden.', 'Min. 30 Flugstunden, davon min. 6 Std. überwachter Alleinflug und einem Überlandflug von min. 150 KM mit Landung auf einem anderem Flugplatz.', '[{\"name\":\"Aufnahmegeb\\u00fchr Verein Neuburg\",\"value\":\"250\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"219\"},{\"name\":\"30 Flugstunden a 185\\u20ac\",\"value\":\"5550\"},{\"name\":\"30 Fluglehrerstunden a 45\\u20ac\",\"value\":\"1350\"}]', '2020-09-28 13:26:02', '2020-09-28 13:26:02'),
(12, 1, 'LAPL(A)', 'Segelflug zu LAPL (A)', NULL, 'Wird im Rahmen der praktischen Flugausbildung vermittelt.', 'Mind. 15 Std. Flugausbildung.\nMind. 6 Std. überwachter Alleinflug mit einem 150 KM Flug und einer Landung auf fremden Platz.', '[{\"name\":\"Aufnahmegeb\\u00fchr Verein Neuburg\",\"value\":\"250\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"250\"},{\"name\":\"15 Flugstunden a 185\\u20ac\",\"value\":\"2775\"},{\"name\":\"15 Fluglehrerstunden a 45\\u20ac\",\"value\":\"675\"}]', '2020-09-28 13:27:20', '2020-09-28 13:27:20'),
(13, 1, 'LAPL(A)', 'Segelflug + „TMG“ zum LAPL(A)', NULL, 'Wird im Rahmen der praktischen Flugausbildung vermittelt.', 'Mind. 3 Std. Flugausbildung\n10 Starts und Landungen mit Fluglehrer\n10 Starts und Landungen im überwachten Alleinflug', '[{\"name\":\"Aufnahmegeb\\u00fchr Verein Neuburg\",\"value\":\"250\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"50\"},{\"name\":\"3 Flugstunden a 185\\u20ac\",\"value\":\"555\"},{\"name\":\"3 Fluglehrerstunden a 45\\u20ac\",\"value\":\"135\"}]', '2020-09-28 13:28:59', '2020-09-28 13:28:59'),
(14, 1, 'Lehrberechtigungen', 'FI(A) - Ausbildung', NULL, 'Blockunterricht Lehren und Lernen	25 Stunden	3 Tage Frontalunterricht vor Ort\nVorbereitung Theorieunterricht	29 Stunden	Selbst-Studium – kann von zu Hause erfolgen\nBlockunterricht Theorie	32 Stunden	4 Tage Frontalunterricht vor Ort\nTests	7 Stunden	\nFlug Briefings	32 Stunden	In die praktische Ausbildung integriert\nSumme	125 Stunden', '30 Std. Flugausbildung', '[{\"name\":\"Verwaltungsgeb\\u00fchr Punitzflug (ATO)\",\"value\":\"1030\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"200\"},{\"name\":\"Theorie mit Briefings (komplett)\",\"value\":\"1500\"},{\"name\":\"27.5 Flugstunden a 185 \\u20ac\",\"value\":\"5087,50\"},{\"name\":\"25 Fluglehrerstunden a 55\\u20ac\",\"value\":\"1375\"}]', '2020-09-28 13:31:05', '2020-09-28 13:31:05'),
(15, 1, 'Lehrberechtigungen', 'CRI(A) - Ausbildung', NULL, 'Blockunterricht Lehren und Lernen:     25Std.  (3 Tage Frontalunterricht vor Ort)\nBlockunterricht Theorie    7Std.  (1 Tage Frontalunterricht vor Ort)\nBriefings Fliegen    3Std.  In die praktische Ausbildung integriert', '3 Stunden Flugausbildung', '[{\"name\":\"Verwaltungsgeb\\u00fchr Punitzflug (ATO)\",\"value\":\"390\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"150\"},{\"name\":\"Theorie mit Briefings (komplett)\",\"value\":\"500\"},{\"name\":\"3 Flugstunden a 185 \\u20ac\",\"value\":\"555\"},{\"name\":\"3 Fluglehrerstunden a 55\\u20ac\",\"value\":\"165\"}]', '2020-09-28 13:32:40', '2020-09-28 13:33:24'),
(16, 1, 'Lehrberechtigungen', 'IRI - Lehrgang', NULL, NULL, NULL, '[{\"name\":\"Verwaltungsgeb\\u00fchr Punitzflug (ATO)\",\"value\":\"390\"},{\"name\":\"INflight Verwaltungsgeb\\u00fchr\",\"value\":\"150\"},{\"name\":\"25 Unterrichtsstunden Lehren und Lernen\\t(entf\\u00e4llt bei FI(A))\",\"value\":\"400\"},{\"name\":\"10 Stunden fachliche Ausbildung IR\",\"value\":\"160\"},{\"name\":\"10 Flugunterrichtsstunden a 240 \\u20ac (Auf 5 Std. reduziert , wenn bereits FI (A) )\",\"value\":\"2400\"}]', '2020-09-28 13:36:09', '2020-09-28 13:36:09');
INSERT INTO `events` (`id`, `user_id`, `title`, `body`, `etdZ`, `etaZ`, `created_at`, `updated_at`, `company_id`) VALUES
(1, 3, 'Hallengrillen', 'Wie viele von euch wissen, stellen wir die Piper und Cessna dem LSV JG 74 „M“ für Ihre Ausbildung zur Verfügung. Dies sehr gut funktionierende Zusammenarbeit wollen wir feiern.\r\nDazu laden wir euch zu unserem nächsten Hallengrillen ein. Freitag 20.09.2019 ab 18:00 Uhr geht es los. Und wie immer wird es genug zu Essen und Trinken geben.\r\nWir würden uns wieder freuen, viele von euch zu sehen. Zu Planungszwecken würde ich euch bitten, mir kurz Bescheid zu geben ob Ihr kommt.\r\nWie immer sind die Partner und Kinder natürlich auch herzlich eingeladen mit zu kommen….', '2019-09-20 16:00:00', '2019-09-20 21:00:00', '2019-09-08 09:05:25', '2019-09-08 09:05:25', 1),
(2, 3, 'BZF Kurs', 'Wer braucht noch einen Funksprechkurs oder einfach mal wieder einen Refresher? Bitte schnell sein. Es gibt „nur“ noch ein paar Restplätze.\r\nFreue mich auf eure Anmeldung per eMai.', '2019-09-28 08:00:00', '2019-09-28 14:30:00', '2019-09-08 09:22:45', '2019-09-08 09:22:45', 1),
(3, 3, 'LadiesNight der INflight', 'Lieber Männer! Jetzt sind eure Frauen dran. Bei einem gemütlichen uns ausgiebigen Frühstück bringen wir euren Frauen, die Grundlagen des fliegen bei.\r\nKeine Angst, wir wollen Sie nicht mit Theorie langweilen, sondern über die wichtigsten Funktionen bei einem Notfall informieren. Wir freuen uns auf viele Anmeldungen eurer Frauen. :-)\r\nFür die fliegenden Frauen unter uns: Eure Männer sind natürlich ebenfalls herzlich willkommen!', '2019-11-09 09:00:00', '2019-11-09 22:00:00', '2019-09-08 09:25:05', '2019-09-08 09:25:05', 1),
(5, 3, 'Unterricht (Navigation) mit Toni', '1. Block: \r\nNavigationsthemen: Kursdreieck, Funknavigation anhand des Fragenkataloges', '2020-01-05 11:00:00', '2020-01-05 15:00:00', '2019-12-13 07:06:35', '2019-12-13 07:06:35', 1),
(6, 3, 'Unterricht (Flugleistung, Flugplanung, Massenverteilung)', '2. Block: Flugleistung, Flugplanung, Massenverteilung anhand des Fragenkataloges', '2020-01-12 11:00:00', NULL, '2019-12-13 07:07:47', '2019-12-13 07:07:47', 1),
(7, 3, 'Die perfekte Prüfungsvorbereitung anhand des Beispiels Prüfungsrunde (mit METAR, TAFs, NOTAM etc…..)', '3. Block: Die perfekte Prüfungsvorbereitung anhand des Beispiels Prüfungsrunde (mit METAR, TAFs, NOTAM etc…..) mit Wolfgang.\r\nGenauen Uhrzeiten folgen noch', '2020-01-19 11:00:00', NULL, '2019-12-13 07:08:44', '2019-12-13 07:08:44', 1),
(8, 3, 'BZF Kurs mit Jörg', 'BZF Kurs mit Jörg \"the Schnattergans\" Baustetter\r\n\r\nGenaue Zeiten folgen...', '2020-01-11 11:00:00', NULL, '2019-12-13 07:10:22', '2019-12-13 07:10:22', 1),
(9, 3, 'Unser großer Fliegerbrunch', 'Für alle Vereine, Piloten und luftfahrtbegeisterte aus der Region wollen\r\nwir für nette Unterhaltungen und Erfahrungsaustausch\r\nzu einem Fliegerbrunch einladen.\r\nDieser findet am Sonntag, 02.02.2020 ab 10:00 Uhr im Cafe des\r\nzivilen Teils am Flugplatzes Ingolstadt Manching (IMA) statt.\r\nGastredner:\r\nMarwin Knoblauch - \"L-29-Delfin, L-39 Albatros, JAK-52: \"Die fliegerische Freiheint in Russland?\"\r\nDesign Engineer (DE) Avionics, Electronics & System Integration, Co-founder sky[nav]pro, Passionierter Pilot\r\nUnd das gibt es:\r\nFrühstücksbüfett mit Wurst, Käse & Lachs\r\nKonfitüren & Honig\r\nObst, Obstsalat, Joghurt & Müsli\r\nFrische Weiße und süßer Senf\r\nEierspeisen (Rührei, Spiegelei mit Käse/Bacon/Tomate auf Wunsch)\r\nGroßer Brot - Semmel & Brezn - Korb, Kleine Croissants\r\nKaffee, Tee, Orangensaft und Mineralwasser\r\nzum Abschluss Suppe nach dem Gastvortrag\r\nKosten für den Brunch \"all you can eat and drink\": 19,90€/pro Person.\r\nWir würden uns freuen, euch alle, gerne auch mit Begleitung,\r\nbegrüßen zu dürfen.\r\nFür die bessere Planung und Koordination bitten wir um Teilnahmebestätigung bis 25.01.2020 an:\r\ninfo@INflight-charter.de', '2020-02-02 09:00:00', NULL, '2019-12-13 07:11:58', '2019-12-13 07:11:58', 1);
